pragma solidity >=0.4.22 <0.7.0;

contract ContestRecord {
    
    address admin;
    //sponsor
    mapping(address => bool) authedSponer;
    //team
    mapping(address => bool) authedTeam;
    
    //sponsor
    mapping(address => Sponsor) registeredSponor;
    //sponsor addr->ID
    mapping(uint => address) sIDtoAddress;
    //sponsor
    mapping(uint => bool) isResteredSponor;

    //team
    mapping(address => Team) registeredTeam;
    //team addr->ID
    mapping(uint => address) tIDtoAddress;
    //team
    mapping(uint => bool) isResteredTeam;


    //record
    Record tempRecord;
    //rIDrecord
    mapping(uint => Record) rIDtoRecord;
    //sIDrecord
    mapping(uint => Record[]) sIDtoRecord;
    //tIDrecord
    mapping(uint => Record[]) tIDtoRecord;
    
    //match
    Match tempMatch;
    //mIDmatch
    mapping(uint => Match) mIDtoMatch;
    //rIDmatch
    mapping(uint => Match[]) rIDtoMatch;
    //tIDmatch
    mapping(uint => Match[]) tIDtoMatch;
    
    
    //sponsor
    struct Sponsor{
        address sAccount;
        uint sID;
        string sName;
        string sNation;
        string sLocation;
        string sEmail;
        string sWeb;
        bool sisActive;
    }
    
    //team
    struct Team{
        address tAccount;
        uint tID;
        string tName;
        string tNation;
        string tLocation;
        string tEmail;
        string tWeb;
        bool tisActive;
    }
    
    
    //record
    struct Record {
        uint rID;
        string rGameName;
        string rContestName;
        string rTime;
        string rLocation;
        uint tIDa;
        uint tIDb;
        string rResult;
        uint sID;
        bool risActive;
    }
    
    //match
    struct Match{
        uint mID;
        uint rID;
        uint tID;
        string player;
        string KDA;
        string mResult;
        string other;
        bool misActive;
        
    }
    
    
    
    
    //event
    
    // 
    //sponsor
    event e_activeSponor(
        uint sID, 
        address SponsorAddress);
    
    //sponsor
    event e_freezeSponor(
        uint sID, 
        address SponsorAddress);
    
    //team
    event e_activeTeam(
        uint tID,
        address TeamAddress);

    //team
    event e_freezeTeam(
        uint tID,
        address TeamAddress);
    
     
    //
    //spons address
    event e_getAddedSponorbyAddr(
        address sAccount,
        uint sID,
        string sName,
        string sNation,
        string sLocation,
        string sEmail,
        string sWeb,
        bool sisActive);
        
    //team address
    event e_getAddedTeambyAddr(
        address tAccount, 
        uint tID, 
        string tName, 
        string tNation, 
        string tLocation,
        string tEmail, 
        string tWeb,
        bool tisActive);
        
    
    //sIDaddress
    event e_getAddedSponorbysID(
        address sAccount,
        uint sID);
        
        
    //tIDaddress
    event e_getAddedTeambytID(
        address tAccount,
        uint tID);
    
    
    //rID
    event e_getAddedRecordbyrID(
        uint rID, 
        string rGameName, 
        string rContestName, 
        string rTime, 
        string rLocation,
        uint tIDa, 
        uint tIDb, 
        string rResult, 
        uint sID);
    
    //mID
    event e_getAddedMatchbymID(
        uint mID,
        uint rID,
        uint tID,
        string player,
        string KDA,
        string mResult,
        string other);
    
    
    
    
    //
    event e_addSponorInstance(
        address newSponsorAddress, 
        uint sID, 
        string sName, 
        string sNation,
        string sLocation,
        string sEmail, 
        string sWeb);
    //
    event e_addRecord(
        uint rID, 
        string rGameName, 
        string rContestName, 
        string rTime, 
        string rLocation,
        uint tIDa, 
        uint tIDb, 
        string rResult, 
        uint sID);
       

    //team
    event e_addTeamInstance(
        address newTeamAddress, 
        uint tID, 
        string tName, 
        string tNation, 
        string tLocation,
        string tEmail, 
        string tWeb);
    //team
    event e_addMatch(
        uint mID,
        uint rID,
        uint tID,
        string player,
        string KDA,
        string mResult,
        string other);
    
    
    
    
    
    
    
    //
    modifier onlyAdmin{
        require(msg.sender == admin);
        _;
    }
    
    
    
    
    
    
    ////
    
    //
    function activeSponor(uint sID) public onlyAdmin{
        //
        require(sIDtoAddress[sID] != address(0));
        //
        authedSponer[sIDtoAddress[sID]] = true;
        //event
        emit e_activeSponor(sID, sIDtoAddress[sID]);
    }
    
    
    //
    function freezeSponor(uint sID) public onlyAdmin{
        //
        require(sIDtoAddress[sID] != address(0));
        //
        authedSponer[sIDtoAddress[sID]] = false;
        //event
        emit e_activeSponor(sID, sIDtoAddress[sID]);
    }
    
    
    //
    function activeTeam(uint tID) public onlyAdmin{
        //
        require(tIDtoAddress[tID] != address(0));
        //
        authedTeam[tIDtoAddress[tID]] = true;
        //event
        emit e_activeTeam(tID, tIDtoAddress[tID]);
    }
    
    
    //
    function freezeTeam(uint tID) public onlyAdmin{
        //
        require(tIDtoAddress[tID] != address(0));
        //
        authedTeam[tIDtoAddress[tID]] = false;
        //event
        emit e_freezeTeam(tID, tIDtoAddress[tID]);
    }
    
    
    
    
    
    
    
    
    ////
    //address
    function getAddedSponorbyAddr(address SponsorAddress) public returns(
        address sAccount, 
        uint sID, 
        string memory sName,
        string memory sNation, 
        string memory sLocation,
        string memory sEmail, 
        string memory sWeb, 
        bool sisActive){
        
        //sponsor
        require(registeredSponor[SponsorAddress].sisActive == true);
        //sponsor
        Sponsor storage sponsor = registeredSponor[SponsorAddress];
        
        //event
        emit e_getAddedSponorbyAddr(
            SponsorAddress, 
            sponsor.sID, 
            sponsor.sName, 
            sponsor.sNation, 
            sponsor.sLocation,
            sponsor.sEmail, 
            sponsor.sWeb, 
            sponsor.sisActive);
        
        //
        return(
            SponsorAddress, 
            sponsor.sID, 
            sponsor.sName, 
            sponsor.sNation, 
            sponsor.sLocation,
            sponsor.sEmail, 
            sponsor.sWeb,
            sponsor.sisActive);
    }
    
    //address
    function getAddedTeambyAddr(address TeamAddress) public returns(
        address tAccount, 
        uint tID, 
        string memory tName, 
        string memory tNation, 
        string memory tLocation,
        string memory tEmail, 
        string memory tWeb, 
        bool tisActive)  {
            
        //
        require(registeredTeam[TeamAddress].tisActive == true);
        
        //
        Team storage team = registeredTeam[TeamAddress];
        
        //event
        emit e_getAddedTeambyAddr(
            TeamAddress, 
            team.tID, 
            team.tName, 
            team.tNation, 
            team.tLocation,
            team.tEmail, 
            team.tWeb, 
            team.tisActive);
        
        //
        return(
            TeamAddress, 
            team.tID,
            team.tName, 
            team.tNation, 
            team.tLocation,
            team.tEmail, 
            team.tWeb, 
            team.tisActive);
    }
    
    
    ////sIDaddress
    function getAddedSponorbysID(uint _sID) public returns(
        address sAccount,
        uint sID){
        require(sIDtoAddress[_sID] != address(0));
        emit e_getAddedSponorbysID(
            sIDtoAddress[_sID],
            _sID);
        return(
            sIDtoAddress[_sID],
            _sID);
        }

        
        
    //tIDaddress
    function getAddedTeambytID(uint _tID) public returns(
        address tAccount,
        uint tID){
        require(tIDtoAddress[_tID] != address(0));
        emit e_getAddedTeambytID(
            tIDtoAddress[_tID],
            _tID);
        return(
            tIDtoAddress[_tID],
            _tID);
        }
    
    
    //mIDrecord
    function getAddedRecordbyrID(uint _rID) public returns(
        uint rID, 
        string memory rGameName, 
        string memory rContestName,
        string memory rTime, 
        string memory rLocation,
        uint tIDa, 
        uint tIDb, 
        string memory rResult, 
        uint sID){
        //record 
        require(rIDtoRecord[_rID].risActive == true);
        //record
        Record storage record = rIDtoRecord[_rID];
        //event
        emit e_getAddedRecordbyrID(
            record.rID,
            record.rGameName,
            record.rContestName,
            record.rTime,
            record.rLocation,
            record.tIDa,
            record.tIDb,
            record.rResult,
            record.sID);
        //
        return(
            record.rID,
            record.rGameName,
            record.rContestName,
            record.rTime,
            record.rLocation,
            record.tIDa,
            record.tIDb,
            record.rResult,
            record.sID);    
        }
    
    //mID
    function getAddedMatchbymID(uint _mID) public returns(
        uint mID,
        uint rID,
        uint tID,
        string memory player,
        string memory KDA,
        string memory mResult,
        string memory other){
        // 
        require(mIDtoMatch[_mID].misActive == true);
        //match
        Match storage m = mIDtoMatch[_mID];
        //event
        emit e_getAddedMatchbymID(
            m.mID,
            m.rID,
            m.tID,
            m.player,
            m.KDA,
            m.mResult,
            m.other);
        //
        return(
            m.mID,
            m.rID,
            m.tID,
            m.player,
            m.KDA,
            m.mResult,
            m.other);    
        }
    
    
    
   ////
    //
    function addSponorInstance(
        address newSponsorAddress, 
        uint sID, 
        string memory sName, 
        string memory sNation,
        string memory sLocation,
        string memory sEmail, 
        string memory sWeb) public {
            
        //
        require(!isResteredSponor[sID]);
        //
        require(newSponsorAddress == msg.sender);
        //IDaddress
        sIDtoAddress[sID] = newSponsorAddress;
        //
        registeredSponor[newSponsorAddress] = Sponsor({
            sAccount : newSponsorAddress,
            sID : sID, 
            sName : sName, 
            sNation : sNation, 
            sLocation : sLocation,
            sEmail : sEmail, 
            sWeb :sWeb, 
            sisActive : true});
        isResteredSponor[sID] = true;
        //event
        emit e_addSponorInstance(
            newSponsorAddress, 
            sID, 
            sName, 
            sNation, 
            sLocation,
            sEmail, 
            sWeb);
    }


    //
    function addRecord(
        uint rID, 
        string memory rGameName, 
        string memory rContestName,
        string memory rTime, 
        string memory rLocation,
        uint tIDa, 
        uint tIDb, 
        string memory rResult, 
        uint sID) public{
        //
        require(registeredSponor[msg.sender].sisActive == true);
        //
        require(authedSponer[msg.sender] == true);
        
        //
        tempRecord = Record({
            rID : rID, 
            rGameName : rGameName, 
            rContestName :rContestName, 
            rTime : rTime, 
            rLocation : rLocation,
            tIDa : tIDa, 
            tIDb : tIDb, 
            rResult : rResult, 
            sID : sID, 
            risActive : true});
        //rID
        rIDtoRecord[rID] = tempRecord;
        //sID
        sIDtoRecord[sID].push(tempRecord);
        //tID
        tIDtoRecord[tIDa].push(tempRecord);
        tIDtoRecord[tIDb].push(tempRecord);
        
        emit e_addRecord(
            rID, 
            rGameName, 
            rContestName, 
            rTime, 
            rLocation,
            tIDa,
            tIDb, 
            rResult, 
            sID);
    }
        
        
        
    ////Team
    //
    function addTeamInstance(
        address newTeamAddress, 
        uint tID, 
        string memory tName, 
        string memory tNation, 
        string memory tLocation,
        string memory tEmail, 
        string memory tWeb) public {
        //
        require(!isResteredTeam[tID]);
        //
        require(newTeamAddress == msg.sender);
        //IDaddress
        tIDtoAddress[tID] = newTeamAddress;
        //
        registeredTeam[newTeamAddress] = Team({
            tAccount : newTeamAddress,
            tID : tID, 
            tName : tName, 
            tNation : tNation, 
            tLocation : tLocation,
            tEmail : tEmail, 
            tWeb :tWeb, 
            tisActive : true});  
        isResteredTeam[tID] = true;
        //event
        emit e_addTeamInstance(
            newTeamAddress, 
            tID, 
            tName ,
            tNation, 
            tLocation,
            tEmail, 
            tWeb);
        }
        
    
    //team
    function addMatch(
        uint mID,
        uint rID,
        uint tID,
        string memory player,
        string memory KDA,
        string memory mResult,
        string memory other) public{
        //team
        require(registeredTeam[msg.sender].tisActive == true);
        require(authedTeam[msg.sender] == true);
        
        //
        tempMatch = Match({
            mID : mID,
            rID : rID,
            tID : tID,
            player : player,
            KDA : KDA,
            mResult : mResult,
            other : other,
            misActive : true});
        //mID
        mIDtoMatch[mID] = tempMatch;
        //teamtID
        tIDtoMatch[tID].push(tempMatch);
        //rID
        rIDtoMatch[rID].push(tempMatch);
        
        emit e_addMatch(
            mID,
            rID,
            tID,
            player,
            KDA,
            mResult,
            other);
    }    


}
